import React, {useState} from 'react';
import ReactDOM from 'react-dom';
import './index.css'
import contact from './contacts'
import Xam from './Xam'
import * as cal from './Heading'
import Taothe from './taothe'
import {  BrowserRouter as Router,Route, Routes, Link, Navigate} from 'react-router-dom'



function App() {
  const [items, setItems] = useState([]);
  return (
  <Router>
      <Navigate to = "/taothe" />
      <div>
        <Link to="/taothe">the</Link>
        <Link to="/Xam">xam</Link>
      </div>
      <Routes> 
       <Route exact path = "/taothe" element = {<Taothe/>} />
       <Route exact path = "/Xam" element = {<Xam />} />
       <Route exact path = "/Xam" element = {<Xam />} />
      </Routes>    
  </Router>
  )
 }

export default App;
